    &quot; So... it's your turn to feed the mandrakes... I'll do the Kraken
      and the woolly mammoth. &quot; 

    &quot; I did the mandrakes last time! Why can't I feed the leprechauns for
      a change? &quot; 

    &quot; Now, now... you know how the leprechauns bite. You're lucky they
      were able to sew your nose back on. &quot; 

    &quot; But I hate the mandrakes! They scream and scream and I get all
      flustered. At least let me feed the Boy Made Of Cheese. &quot; 

    &quot; All right, all right! You can do the Boy Made Of Cheese... but only
      if you feed the chickens as well! &quot; 

    &quot; Chickens? Chickens?? Haw haw haw haw haw! You must think I'm really
      dumb... everybody knows there's no such thing as chickens! &quot; 

     --  The Zookeepers, supplementary strip, issue three


